                        {item.name}
                      </StyledTableCell>
                      <StyledTableCell align="right">
                        {item.mail}
                      </StyledTableCell>
                      <StyledTableCell align="right">
                        {item.phone}
                      </StyledTableCell>
                      {/* <StyledTableCell align="right">
                  {item.password}
                </StyledTableCell> */}
                      <StyledTableCell align="right">
                        {item.typePayment}
