                      </StyledTableCell>
                      <StyledTableCell align="right">
                        {item.longitude}
                      </StyledTableCell>
                      <StyledTableCell align="right">
                        {item.type}
                      </StyledTableCell>
                      <StyledTableCell align="right">
                        {item.commission_rate}
                      </StyledTableCell>
                      <StyledTableCell align="right">
                        {item.logourl}
