                      <StyledTableCell align="right">
                        {item.discount}
                      </StyledTableCell>
                      {/* <StyledTableCell align="right">
                        {item.deal}
                      </StyledTableCell> */}
                      <StyledTableCell align="right">

                      <Link to={{
                          pathname: '/PartnersUpdate',

                          state: { ligne: { item } }
                        }} >
                          <Button style={{ marginLeft: '20px', marginTop: '50px', backgroundColor: '#008037' }} variant="outline-success" >
                            <EditIcon />

                          </Button>
                        </Link>
                      </StyledTableCell>
                      
                      <Partnercomponent item={item.restaurant_id} handleClose={handleClose} handleClose1={handleClose1} />
                     
               
                    </StyledTableRow>
                  );
                })}
          </TableBody>
            </Table>
          </TableContainer>
        <TablePagination
          rowsPerPageOptions={[10, 25, 100]}
          component="div"
          count={data.data.length}
          rowsPerPage={rowsPerPage}
          page={page}
          onChangePage={handleChangePage}
          onChangeRowsPerPage={handleChangeRowsPerPage}
        />
        </Paper>


    </div>

    </div >

  )

}
